import React from "react";


export const LoginForm = ({
    username,
    setUsername,
    password,
    setPassword
}) => {
    return (
        <form /*onSubmit={handleSubmit}*/>
            <label>
                Username:
                <input type='text' value={username} onChange={(e) => setUsername(e.target.value)}/>
            </label>
    


            <h2>Username</h2>
            <h2>Password</h2>
            <h2>LOGIN</h2>
            <p>Forgot Username?</p>
            <p>Forgot Password?</p>
            <p>Create account</p>
        </form>
  );
}
